import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import api from '../services/api';

export default function TutorList() {
  const [tutores, setTutores] = useState([]);

  useEffect(() => {
    api.get('/tutores').then((res) => setTutores(res.data));
  }, []);

  return (
    <div className="container my-5">
      <div className="d-flex justify-content-between mb-3">
        <Link to="/" className="btn btn-secondary">← Voltar ao Início</Link>
        <Link to="/tutores/novo" className="btn btn-primary">+ Cadastrar Novo Tutor</Link>
      </div>
      <h2>Tutores Cadastrados</h2>
      <ul className="list-group mt-3">
        {tutores.map((t) => (
          <li key={t._id} className="list-group-item">
            <Link
              to={`/tutores/${t._id}`}
              style={{ textDecoration: 'none', color: 'inherit' }}
            >
              <strong>{t.nome}</strong> – CPF: {t.cpf}
            </Link>
          </li>
        ))}
      </ul>
    </div>
  );
}
